import { Box, Typography } from "@mui/material";
import React from "react";
import {Search, MoreVert} from "@mui/icons-material";

const ChatHeader=()=>{
    return (
        <Box>
            <img src={''} alt="dp"></img>
            <Box>
                <Typography>Name</Typography>
                <Typography>Offline</Typography>
            </Box>
            <Box>
                <Search />
                <MoreVert />
            </Box>
        </Box>
    );
}

export default ChatHeader;
